import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';


function MCard(props) {

    return (


        <Card className='shadow rounded-0 border-0' variant="light">
          <Card.Img variant="top" className='rounded-0' src={props.obj.img} />

          <Card.Body>

            <Card.Title className='fs-4 fw-600 py-1' >{props.obj.title}</Card.Title>

            <Card.Text className='crop-text-2' >
              {props.obj.description}
            </Card.Text>

            <Row >

              <Col md="auto">
                <Card.Text className='fw-600'>
                  {props.obj.author}
                </Card.Text>
              </Col>

              <Col md="auto" className="vl p-0" />

              <Col md="auto">
                <Card.Text >
                  {props.obj.author}
                </Card.Text>
              </Col>

            </Row>

          </Card.Body>

        </Card>


    )
}

export default MCard;
